import { memo } from "react";
import "./FrameComponent11.css";
const FrameComponent11 = memo(() => {
  return (
    <div className="frame-parent223">
      <div className="mask-group-parent1">
        <img className="mask-group-icon6" alt="" src="/mask-group1@2x.png" />
        <div className="student-portals-have-been-acti-parent1">
          <div className="student-portals-have3">
            Student portals have been activated. You can now login and set up
            your profile
          </div>
          <div className="from-to-date3">
            <div className="dean-of-students3">Dean of Students</div>
            <div className="from-to-date-child3" />
            <div className="to-students3">To students</div>
            <div className="from-to-date-child4" />
            <div className="dean-of-students3">15 Mar 2023</div>
          </div>
        </div>
      </div>
      <div className="frame-child74" />
    </div>
  );
});

export default FrameComponent11;
